import React from 'react';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';
import '../Tools/live.css';
 
const Calendar = () => (
  <div><script class="powered" type="text/javascript" src="https://widgets.myfxbook.com/scripts/fxCalendar.js"></script>
                            <div style={{color: "#706f6f", fontWeight: "bold", fontSize: 11, fontFamily: Tahoma}}>Powered by 
                            <a href="https://www.myfxbook.com"class="myfxbookLink" ></a></div>
                            <script type="text/javascript">showCalendarWidget()</script>
                            </div>
);

export default Calendar;
